import { Container } from "react-bootstrap";
import GamePageLoggedInView from "../components/GamePageLoggedInView";
import GamePageLoggedOutView from "../components/GamePageLoggedOutView";
import { GamePageProps } from "../components/types";


const GamePage = ({loggedInUser}:GamePageProps) => {
    return ( 
        <Container className={styles.NotePage}>
        <>
        {
          loggedInUser
          ? <GamePageLoggedInView />
          : <GamePageLoggedOutView /> 
        }
        </>
        </Container>

     );
}

export default GamePage;
